import './App.css';

import Login from './components/Login';
import Navbar from './components/Navbar';
import Register from './components/Register';

import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <>
    <Router>
    <Navbar />


      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
      </Router>
    </>
  );
}

export default App;
